// Sidebar.js
import { Link } from 'react-router-dom';
import { FaPhone, FaEnvelope, FaMapMarkerAlt } from 'react-icons/fa';

const Sidebar = () => {
  return (
    <aside className="w-64 bg-gray-800 text-white h-full p-4">
      <nav className="space-y-4">
        <Link to="/call-log" className="flex items-center space-x-2 p-2 hover:bg-gray-700 rounded">
          <FaPhone className="text-blue-400" />
          <span>Call Log</span>
        </Link>

        <Link to="/messages" className="flex items-center space-x-2 p-2 hover:bg-gray-700 rounded">
          <FaEnvelope className="text-green-400" />
          <span>Messages</span>
        </Link>

        <Link to="/location" className="flex items-center space-x-2 p-2 hover:bg-gray-700 rounded">
          <FaMapMarkerAlt className="text-red-400" />
          <span>Location</span>
        </Link>
      </nav>
    </aside>
  );
};

export default Sidebar;
